import React, { Component } from "react";
import Header from "../../component/Header";
import MaterialTable from "material-table";
import { Container, Table, Button } from "semantic-ui-react";

class Items extends Component {
  render() {
    const item = [
      { id: "1", name: "Milk" },
      { id: "2", name: "Matcha" },
      { id: "3", name: "Tea" },
      { id: "4", name: "Coffea" }
    ];
    const renderItems = (items, index) => {
      return (
        <tr>
          <td>{items.id}</td>
          <td>{items.name}</td>
        </tr>
      );
    };

    return (
      <Container>
        <div>
          <Header />
          <h2>Items</h2>
          <table class="ui red table">
  <thead>
    <tr><th>Food</th>
    <th>Calories</th>
    <th>Protein</th>
  </tr></thead><tbody>
    <tr>
      <td>Apples</td>
      <td>200</td>
      <td>0g</td>
    </tr>
    <tr>
      <td>Orange</td>
      <td>310</td>
      <td>0g</td>
    </tr>
  </tbody>
</table>
          <hr></hr>
          <Button outline color="info">
            Reload
          </Button>{" "}
        </div>
      </Container>
    );
  }
}

export default Items;
